window.onload = function() {
    document.getElementById("search").onclick = function () {
        var input = document.getElementById("start");
        var toSearch = input.value;
        if (toSearch.length != 1)
            alert("비정상적인 시작음절입니다.");
        var charCode = toSearch[0].charCodeAt(0);
        if (charCode < 0xAC00 || charCode > 0xD7A3)
            alert("비정상적인 시작음절입니다.");
        var attack = document.getElementById("attack");
        var subAttack = document.getElementById("subAttack");
        var defense = document.getElementById("defense");
        attack.innerHTML = "";
        subAttack.innerHTML = "";
        defense.innerHTML = "";
        if (ATTACK_MAP[toSearch] != null && ATTACK_MAP[toSearch].length > 0)
            attack.innerHTML = ATTACK_MAP[toSearch].join(' ');
        if (SUBATTACK_MAP[toSearch] != null && SUBATTACK_MAP[toSearch].length > 0)
            subAttack.innerHTML = SUBATTACK_MAP[toSearch].join(' ');
        if (DEFENSE_MAP[toSearch] != null && DEFENSE_MAP[toSearch].length > 0)
            defense.innerHTML = DEFENSE_MAP[toSearch].join(' ');
    };
};